INSERT INTO public.library_task_recommendations (library_task_id, library_hazard_id, library_control_id)
SELECT recommendations.library_task_id::UUID, recommendations.library_hazard_id::UUID, recommendations.library_control_id::UUID
FROM recommendations
WHERE
    EXISTS (SELECT 1 FROM library_controls WHERE library_controls.id = recommendations.library_control_id::UUID)
    AND EXISTS (SELECT 1 FROM library_hazards WHERE library_hazards.id = recommendations.library_hazard_id::UUID)
    AND EXISTS (SELECT 1 FROM library_tasks WHERE library_tasks.id = recommendations.library_task_id::UUID)
ON CONFLICT (library_task_id, library_hazard_id, library_control_id) DO NOTHING;